import * as types from './../constants/ActionTypes';

// khoi tao ko tham so
let initialState = [];

//truyen ko tham so
let myReducer = (state = initialState, action) => {
    switch(action.type){
        case types.FETCH_TASK:{
            console.log("vao LIST_TASK",action);
            return state;
        }
        case types.ADD_TASK:{
            console.log("vao ADD_TASK",action);
            return state;
        }
        default: return state; //state cua store
    }
}

export default myReducer;
